import React, { useState } from "react";
import { useNavigate } from "react-router-dom"; // Import useNavigate
import "../styles/signup.css";

const Signup = () => {
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    password: "",
  });
  const [error, setError] = useState("");
  const [showPopup, setShowPopup] = useState(false); // State to control pop-up visibility
  const [isPaymentStep, setIsPaymentStep] = useState(false); // State to manage payment step
  const navigate = useNavigate(); // Initialize useNavigate

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const { firstName, lastName, email, password } = formData;

    // Validation
    if (!firstName || !lastName || !email || !password) {
      setError("All fields are required.");
      return;
    }

    if (!/\S+@\S+\.\S+/.test(email)) {
      setError("Please enter a valid email address.");
      return;
    }

    if (password.length < 6) {
      setError("Password must be at least 6 characters long.");
      return;
    }

    // If validation passes, move to payment step
    setError("");
    setIsPaymentStep(true);
  };

  const handlePayment = (e) => {
    e.preventDefault();
    // Simulate payment processing
    console.log("Payment successful");
    setShowPopup(true);

    // Redirect to Home page after 3 seconds
    setTimeout(() => {
      setShowPopup(false);
      navigate("/");
    }, 2000);
  };

  return (
    <div className="signup-page">
      <div className="signup-container">
        {!isPaymentStep ? (
          <>
            <h1 className="signup-title">Join To MAX<span className="highlight">PAIN</span></h1>
            <form className="signup-form" onSubmit={handleSubmit}>
              <div className="form-group">
                <label htmlFor="firstName">First Name</label>
                <input
                  type="text"
                  id="firstName"
                  name="firstName"
                  value={formData.firstName}
                  onChange={handleChange}
                  placeholder="Enter your first name"
                />
              </div>
              <div className="form-group">
                <label htmlFor="lastName">Last Name</label>
                <input
                  type="text"
                  id="lastName"
                  name="lastName"
                  value={formData.lastName}
                  onChange={handleChange}
                  placeholder="Enter your last name"
                />
              </div>
              <div className="form-group">
                <label htmlFor="email">Email Address</label>
                <input
                  type="email"
                  id="email"
                  name="email"
                  value={formData.email}
                  onChange={handleChange}
                  placeholder="Enter your email address"
                />
              </div>
              <div className="form-group">
                <label htmlFor="password">Password</label>
                <input
                  type="password"
                  id="password"
                  name="password"
                  value={formData.password}
                  onChange={handleChange}
                  placeholder="Enter your password"
                />
              </div>
              {error && <p className="error-message">{error}</p>}
              <button type="submit" className="signup-btn">Sign up</button>
            </form>
          </>
        ) : (
          <>
            {/*
            <h1 className="signup-title">Payment</h1>
            <form className="signup-form" onSubmit={handlePayment}>
              <div className="form-group">
                <label htmlFor="cardNumber">Card Number</label>
                <input
                  type="text"
                  id="cardNumber"
                  name="cardNumber"
                  placeholder="Enter your card number"
                />
              </div>
              <div className="form-group">
                <label htmlFor="expiryDate">Expiry Date</label>
                <input
                  type="text"
                  id="expiryDate"
                  name="expiryDate"
                  placeholder="MM/YY"
                />
              </div>
              <div className="form-group">
                <label htmlFor="cvv">CVV</label>
                <input
                  type="text"
                  id="cvv"
                  name="cvv"
                  placeholder="Enter CVV"
                />
              </div>
              <button type="submit" className="signup-btn">Pay Now</button>
            </form>
            */}
          </>
        )}
        {showPopup && (
          <div className="popup-overlay">
            <div className="popup">
              <p>Welcome to Mex Plan! Your account has been created successfully.</p>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Signup;
